Indestructible Hulk Agent Of S.H.I.E.L.D. V1(2012)(Digital)(TLK-EMPIRE-HD)

Mark Waid writes this first volume of the Marvel NOW Hulk series, with art by Leinel Francis Yu. Promotional info - &quot;Hulk for hire! The Incredible Hulk is an indestructible force of nature, more weapon than man. Bruce Banner is the Hulk's human alter-ego, and the smartest man alive. Combined they are the most powerful, most intelligent weapon on the planet - and now they're both working for the government as Marvel NOW! makes the Hulk an agent of S.H.I.E.L.D.! Taking on deadly threats including the Mad Thinker, the Quintronic Man and Attuma, Hulk goes from walking W.M.D. to world saver. But even when playing the hero, the Green Goliath is going to do what he does best...SMASH!&quot;

